import React, { Component } from "react";
import Newsitems from "./Newsitems";

export class News extends Component {
  render() {
    return (
      <>
      <div className="container">
        <h2>This is Hedder</h2>
        <Newsitems second="This is second"/>
        <Newsitems/>  
        <Newsitems/>  
        <Newsitems/>  
      </div>
      </>
    );
  }
}

export default News;
